      },
      {
        "name": "Montmartre",
        "description": "A historic district known for its artistic history, it is famous for the Basilica of the Sacré-Cœur and its bohemian atmosphere.",
        "location": "Montmartre, 75018 Paris"
      },
      {
        "name": "Seine River Cruise",
        "description": "Enjoy scenic views of Paris while cruising along the Seine River, passing famous landmarks.",
        "location": "Seine River"
      },
      {
        "name": "Champs-Élysées and Arc de Triomphe",
        "description": "Famous avenue known for shopping and cafés, leading to the iconic arch honoring those who fought for France.",
        "location": "Place Charles de Gaulle, 75008 Paris"
      },
      {
        "name": "Palace of Versailles",
        "description": "A stunning royal residence located just outside Paris, known for its opulent architecture and beautiful gardens.",
        "location": "Place d'Armes, 78000 Versailles"
      },
      {
        "name": "Musée d'Orsay",
        "description": "An art museum housed in a Beaux-Arts railway station, featuring an extensive collection of Impressionist and Post-Impressionist masterpieces.",
        "location": "1 Rue de la Légion d'Honneur, 75007 Paris"
      }
    ],
    "tips": [
      "Buy tickets in advance for major attractions to avoid long lines.",
      "Try to learn a few basic French phrases; locals appreciate the effort.",
      "Explore different neighborhoods to experience the local culture and cuisine."
    ]
  }
